import Link from 'next/link'

export default function() {
  return <section>
    <div>
      <Link href="./">
         <a class="title nav">Home</a>
      </Link>
      <Link href="./about"> 
         <a class="title nav">About Me</a>
      </Link>
      <Link href="./portifolio">
         <a class="title nav">Portifolio</a>
      </Link>
      <Link href="./contact">
         <a class="title nav">Contact Me</a>
      </Link>
    </div>

    <style jsx global>
      {`
        a {
          padding: 135px;
          text-decoration: none;
          color: orange;
          position: relative;
          top: 30px;
        }
      `}
    </style>
  </section>
}
